let log = console.log
let musicBg,introSFX,correctSFX,wrongSFX,playingOnHide,isTimeMusic
var text_timer = document.getElementById('text_timer');

class Game extends Phaser.Scene {
    constructor() {
        super('game')
    }

    onClickDownload(){
        alert('your url here')
    }

    preload() {
        this.style1 = { font: ' 32px Arial', fill: "#ffffff",stroke: '#ffffff',strokeThickness:2};
        var atlas = 'data:image/png;base64,'
        var atlasJSON = {"frames": [{"filename": "wrong.png", "frame": {"x":827,"y":511,"w":351,"h":329}, "rotated": false, "trimmed": false, "spriteSourceSize": {"x":0,"y":0,"w":351,"h":329}, "sourceSize": {"w":351,"h":329} }, {"filename": "opc_2.png", "frame": {"x":2,"y":511,"w":470,"h":349}, "rotated": false, "trimmed": false, "spriteSourceSize": {"x":0,"y":0,"w":470,"h":349}, "sourceSize": {"w":470,"h":349} }, {"filename": "opc_1.png", "frame": {"x":718,"y":2,"w":470,"h":349}, "rotated": false, "trimmed": false, "spriteSourceSize": {"x":0,"y":0,"w":470,"h":349}, "sourceSize": {"w":470,"h":349} }, {"filename": "logo.png", "frame": {"x":2,"y":862,"w":506,"h":236}, "rotated": false, "trimmed": false, "spriteSourceSize": {"x":0,"y":0,"w":506,"h":236}, "sourceSize": {"w":506,"h":236} }, {"filename": "correct.png", "frame": {"x":474,"y":511,"w":351,"h":329}, "rotated": false, "trimmed": false, "spriteSourceSize": {"x":0,"y":0,"w":351,"h":329}, "sourceSize": {"w":351,"h":329} }, {"filename": "answer.png", "frame": {"x":2,"y":2,"w":714,"h":507}, "rotated": false, "trimmed": false, "spriteSourceSize": {"x":0,"y":0,"w":714,"h":507}, "sourceSize": {"w":714,"h":507} }], "meta": {"app": "https://www.codeandweb.com/texturepacker", "version": "1.0", "image": "assets.png", "format": "RGBA8888", "size": {"w":1190,"h":1190}, "scale": "1", "smartupdate": "$TexturePacker:SmartUpdate:a79e8a6bcb388c325705adf7518c6f5b:1f095b00680bb370db7828a5ba83d1fe:a759b6bbc8381ac9c472b28f589ad0d6$" } }
        this.vid = 'data:video/mp4;base64,'
        this.vidp = 'data:video/mp4;base64,'
        
        var bgL = 'data:image/png;base64,'
        var bgP = 'data:image/png;base64,'
        var hand = 'data:image/png;base64,'
        this.load.image('bgL', bgL);
        this.load.image('bgP', bgP);
        this.load.image('hand', hand);
        this.load.atlas('atlas', atlas, atlasJSON);

        var music = 'data:audio/mp3;base64,'
        var introAudio = 'data:audio/mp3;base64,'
        var correctAudio = 'data:audio/mp3;base64,'
        var incorrectAudio = 'data:audio/mp3;base64,'

        musicBg = new Howl({src: [music], loop: false,volume: 0.5,});
        introSFX = new Howl({src: [introAudio], loop: false,volume: 0.5,});
        correctSFX = new Howl({src: [correctAudio], loop: false,volume: 0.5,});
        wrongSFX = new Howl({src: [incorrectAudio], loop: false,volume: 0.5,});
    }

    scaleSprite (sprite, availableSpaceWidth, availableSpaceHeight, scaleMultiplier) {
        var scale = this.getSpriteScale(sprite.width, sprite.height, availableSpaceWidth, availableSpaceHeight);
        sprite.setScale(scale * scaleMultiplier);
    }

    getSpriteScale (spriteWidth, spriteHeight, availableSpaceWidth, availableSpaceHeight) {
        var ratio = 1;
        var currentDevicePixelRatio = window.devicePixelRatio;
        // Sprite needs to fit in either width or height
        var widthRatio = (spriteWidth * currentDevicePixelRatio + 2 ) / availableSpaceWidth;
        var heightRatio = (spriteHeight * currentDevicePixelRatio + 2 ) / availableSpaceHeight;
        if(widthRatio > 1 || heightRatio > 1){
            ratio = 1 / Math.max(widthRatio, heightRatio);
        }
        return ratio * currentDevicePixelRatio;
    }

    moveTo(sprite,_x,_y){
        this.tweens.add({targets: sprite, x:_x, y:_y, duration: 600, ease: 'Sine.InOut'});
    }

    popup(sprite) {
        this.tweens.add({targets: sprite, scale: {value: sprite.scaleX+0.1}, duration: 400, yoyo:true, ease: 'Sine.In'});
    }

    pulse(sprite) {
        this.tweens.add({targets: sprite, displayWidth:sprite.displayWidth+20,duration: 1000, yoyo:true, repeat:-1})
    }

    addZeros(num) {
        if (num < 10 && num > 0) {
            num = "0" + num;
        }
        return num;
    }

    tick(){
        this.timeInSeconds--
        var seconds = this.timeInSeconds
        var timeString = this.addZeros(seconds);

        text_timer.textContent = timeString

        if (this.timeInSeconds <= 0) {
            this.timerClock.remove()
            this.chooseOption({valueType:2})
        }
    }

    create() {
        isTimeMusic = true
        this.timeInSeconds = 10
	  	this.cameras.main.setBackgroundColor(0xB5E4F9)
	    
	    this.setGameScene()

	    this.scale.on('resize', this.resize, this)
        this.scale.resize(window.innerWidth,window.innerHeight)
    }

    setGameScene(){
        musicBg.play()
        var isLandscape = window.innerHeight / window.innerWidth  < 1.3 ? true: false;

        this.mainVideo = this.add.video(window.innerWidth,window.innerHeight);
        
        if(isLandscape){
            this.mainVideo.loadURL(this.vid, true);
            this.time.delayedCall(14500, this.tap1, [], this)

        }
        else{
            this.mainVideo.loadURL(this.vidp, true);
            this.time.delayedCall(15000, this.tap1, [], this)
        }

        this.mainVideo.setSize(window.innerWidth, window.innerHeight)

        this.mainVideo.play();

        this.input.once('pointerup',  function(){
             if (this.scale.isFullscreen) {
                this.scale.stopFullscreen();
            }
            else {
                this.scale.startFullscreen();
            }
        }, this)

        this.bgCTA = this.add.sprite(0,0, 'bgP').setAlpha(0)
        this.logoCTA = this.add.sprite(0,0, 'atlas', 'logo.png').setAlpha(0)
        this.opc1 = this.add.sprite(0,0, 'atlas', 'opc_1.png').setAlpha(0).setInteractive()
        this.opc1.valueType = 1
        this.opc2 = this.add.sprite(0,0, 'atlas', 'opc_2.png').setAlpha(0).setInteractive()
        this.opc2.valueType = 2
        this.opc1.on('pointerdown', this.chooseOption.bind(this, this.opc1));
        this.opc2.on('pointerdown', this.chooseOption.bind(this, this.opc2));
        this.answerCTA = this.add.sprite(0,0, 'atlas', 'answer.png').setAlpha(0)
        this.correctIcon = this.add.sprite(0,0, 'atlas', 'correct.png').setAlpha(0)
        this.wrongIcon = this.add.sprite(0,0, 'atlas', 'wrong.png').setAlpha(0)
        this.hand = this.add.sprite(0,0, 'hand').setAlpha(0).setOrigin(0.5)

        this.timerClock = this.time.addEvent({ delay: 1000, callback: this.tick, callbackScope: this, loop: true, paused:true });
    }

    chooseOption(obj){
        var isLandscape = window.innerHeight / window.innerWidth  < 1.3 ? true: false;
        if(isLandscape)
            this.logoCTA.setAlpha(0)

        this.opc1.setAlpha(0)
        this.opc2.setAlpha(0)
        this.hand.setAlpha(0)
        this.answerCTA.setAlpha(1)
        this.opc1.disableInteractive()
        this.opc2.disableInteractive()
        text_timer.style.visibility = 'hidden'
        this.timerClock.remove()

        if(obj.valueType == 1){
            this.wrongIcon.setAlpha(1)
            this.popup(this.wrongIcon)
            introSFX.stop()
            wrongSFX.play()
        }
        else{
            this.correctIcon.setAlpha(1)
            this.popup(this.correctIcon)
            introSFX.stop()
            correctSFX.play()
        }

        this.time.delayedCall(2000, this.onClickDownload, [], this)
    }

    tap1(){
        isTimeMusic = false
        this.mainVideo.setAlpha(0)
        this.bgCTA.setAlpha(1)
        this.logoCTA.setAlpha(1)
        this.opc1.setAlpha(1)
        this.opc2.setAlpha(1)
        this.hand.setAlpha(1)
        this.popup(this.opc1)
        this.popup(this.opc2)
        this.tweens.add({targets: this.hand, scale: {value: this.hand.scaleX+0.1}, duration: 500, yoyo:true, repeat:10, ease: 'Linear.None'});
        musicBg.stop()
        introSFX.play()
        text_timer.style.visibility = 'visible'
        this.cameras.main.fadeIn(500, 181, 228, 249)
        this.timerClock.paused = false 
        this.cameras.main.on('camerafadeincomplete', function () {
        }, this);
        //this.hand.once('pointerdown', this.firstEvent, this);
    }

    resize (gameSize, baseSize, displaySize, resolution){
        const width = gameSize.width;
        const height = gameSize.height;
        var isLandscape = height / width  < 1.3 ? true: false;

        //GAME
        if(!isLandscape){
            this.mainVideo.setSize(540,960)
            this.mainVideo.setDisplaySize(width, height)
            this.mainVideo.x = width*0.5
            this.mainVideo.y = height*0.5

            this.bgCTA.setPosition(width*0.5, height*0.5)
            this.bgCTA.setTexture('bgP')
            this.bgCTA.setSize(width,height)
            this.bgCTA.setDisplaySize(width,height)

            this.logoCTA.setPosition(width*0.5, height*0.24)
            //this.logoCTA.setScale(0.5)
            this.scaleSprite(this.logoCTA, width, height ,0.7)

            this.opc1.setPosition(width*0.5, height*0.48)
            //this.opc1.setScale(0.55)
            this.scaleSprite(this.opc1, width, height ,0.7)

            this.opc2.setPosition(width*0.5, height*0.82)
            //this.opc2.setScale(0.55)
            this.scaleSprite(this.opc2, width, height ,0.7)

            this.hand.setPosition(width*0.75, height*0.92)
            this.hand.setScale(0.3)
            //this.scaleSprite(this.hand, width, height/2 ,0.2)

            text_timer.style.bottom = '30%'
            text_timer.style.fontSize = '40px'

            this.answerCTA.setPosition(width*0.5, height*0.6)
            this.scaleSprite(this.answerCTA, width, height ,1)

            this.correctIcon.setPosition(width*0.525, height*0.8)
            this.scaleSprite(this.correctIcon, width, height ,0.5)

            this.wrongIcon.setPosition(width*0.525, height*0.8)
            this.scaleSprite(this.wrongIcon, width, height ,0.5)

            if(height <= 480){
                this.scaleSprite(this.logoCTA, width, height ,0.6)
                this.scaleSprite(this.opc1, width, height ,0.6)
                this.scaleSprite(this.opc2, width, height ,0.6)
                text_timer.style.bottom = '30%'
                text_timer.style.fontSize = '30px'
            }
        }
        else{
            this.mainVideo.setSize(960,540)
            this.mainVideo.setDisplaySize(width, height)
            this.mainVideo.displayHeight = height
            this.mainVideo.x = width*0.5
            this.mainVideo.y = height*0.5

            this.bgCTA.setPosition(width*0.5, height*0.5)
            this.bgCTA.setTexture('bgL')
            this.bgCTA.setSize(width,height)
            this.bgCTA.setDisplaySize(width,height)

            this.logoCTA.setPosition(width*0.5, height*0.18)
            //this.logoCTA.setScale(0.4)
            this.scaleSprite(this.logoCTA, width/2, height ,0.7)

            this.opc1.setPosition(width*0.28, height*0.56)
            //this.opc1.setScale(0.55)
            this.scaleSprite(this.opc1, width, height ,0.5)

            this.opc2.setPosition(width*0.72, height*0.56)
            //this.opc2.setScale(0.55)
            this.scaleSprite(this.opc2, width, height ,0.5)

            this.hand.setPosition(width*0.72, height*0.8)
            this.hand.setScale(0.3)
            //this.scaleSprite(this.hand, width/2, height ,0.2)

            this.answerCTA.setPosition(width*0.5, height*0.5)
            this.scaleSprite(this.answerCTA, width, height ,0.9)

            this.correctIcon.setPosition(this.answerCTA.x + (this.answerCTA.displayWidth*0.5), height*0.8)
            this.scaleSprite(this.correctIcon, width, height ,0.4)

            this.wrongIcon.setPosition(this.answerCTA.x + (this.answerCTA.displayWidth*0.5), height*0.8)
            this.scaleSprite(this.wrongIcon, width, height ,0.4)

            text_timer.style.bottom = '1%'
            text_timer.style.fontSize = '50px'

            if(height <= 320){
                this.scaleSprite(this.answerCTA, width, height ,0.75)
                this.correctIcon.setPosition(this.answerCTA.x + (this.answerCTA.displayWidth*0.5), height*0.8)
                this.scaleSprite(this.correctIcon, width, height ,0.4)

                this.wrongIcon.setPosition(this.answerCTA.x + (this.answerCTA.displayWidth*0.5), height*0.8)
                this.scaleSprite(this.wrongIcon, width, height ,0.4)

            }

            if(this.sys.game.device.os.desktop){
                this.scaleSprite(this.logoCTA, width/2, height ,0.5)
                this.scaleSprite(this.opc1, width, height ,0.7)
                this.scaleSprite(this.opc2, width, height ,0.7)
                this.hand.setScale(0.5)
                text_timer.style.bottom = '1%'
                text_timer.style.fontSize = '60px'
            }

        }
    }       
}

document.addEventListener('visibilitychange',() => {
   if (document.hidden) {
    playingOnHide = !musicBg.muted;
    musicBg.pause();
  } else {
    // Resume playing if audio was "playing on hide"
    if (playingOnHide) {
      if(isTimeMusic)  
        musicBg.play();
    }
  }
});

let config = {
    type: Phaser.WEBGL,
    scene: Game,
    scale: {
       parent:"container",
       fullscreenTarget:"container",
       mode: Phaser.Scale.RESIZE,
       autoCenter: Phaser.Scale.CENTER_BOTH,
       width: window.innerWidth,
       height: window.innerHeight,
       autoRound: true,
    },
}
new Phaser.Game(config)